import tkinter
import time
from tkinter import *
from tkinter import ttk
from tkinter.font import Font


# Interface Class
class Interface():

    # Initialization
    def __init__(self,init_window_name):
        self.init_window_name = init_window_name
        self.set_StringVars()
        self.set_init_window()

        self.tip_LINE_NUM = 0
        self.msg = ['               Good Food,                                         Good Health,                                       Good life!',
                    '   A balanced diet is necessary               for your physical and                          mental well-being!',
                    '   An apple a day is not enough              to keep doctors away......                    by itself.',
                    ' Though water is not included in          this calculation,                                   remember to drink plenty!',
                    'Have fun calculating your meal!          Be sure to get a balanced one!',
                    'Excpet from having a healthy diet,     exercise is very important as well!']
        self.img = tkinter.PhotoImage(data=IMAGE)
        
        # Set font
        self.A_font = Font(family="Edwardian Script ITC", size=50, weight="bold")
        self.B_font = Font(family="Courier",              size=30)
        self.C_font = Font(family="Comic Sans MS",        size=20)
        self.D_font = Font(family="Times New Roman",      size=20)

        self.result_data_Text.tag_configure("ED",   font=self.A_font, foreground = "#9400D3")
        self.result_data_Text.tag_configure("BS",   font=self.B_font, foreground = "#778899")
        self.result_data_Text.tag_configure("QS",   font=self.C_font, foreground = "#708090")

        self.result_data_Text.tag_configure("Ccol", font=self.D_font, foreground = "#1E90FF")
        self.result_data_Text.tag_configure("Pcol", font=self.D_font, foreground = "#FF00FF")
        self.result_data_Text.tag_configure("Mcol", font=self.D_font, foreground = "#32CD32")
        self.result_data_Text.tag_configure("Fcol", font=self.D_font, foreground = "#FF8C00")
        self.result_data_Text.tag_configure("Vcol", font=self.D_font, foreground = "#7B68EE")
        self.result_data_Text.tag_configure("Cnt",  font=self.C_font, foreground = "#696969")

        self.carVal = 0
        self.proVal = 0
        self.minVal = 0
        self.fatVal = 0
        self.vitVal = 0

    def set_init_window(self):


        # Set Window
        self.init_window_name.title("Nutrition Calculator")
        self.init_window_name.geometry('840x560+50+10')

        # Lable on top left
        self.init_data_label = Label(self.init_window_name, bd = 5, foreground = "#696969", font=('Comic Sans MS', 20),text="Your Meal Components!")
        # self.init_data_label.tag_add("QS", "1.0", END)
        self.init_data_label.place(x=20, y=0, anchor=NW)

        # All five comboboxes
        self.set_Combox()

        # Result display
        self.result_data_Text = Text(self.init_window_name, foreground = "#696969",font=('Times New Roman', 12), width=53, height=28)  
        self.result_data_Text.place(x=400, y=10, anchor=NW)

        # Tips
        self.tip_data_Text = Text(self.init_window_name, foreground = "#708090",font=('Times New Roman', 18), width=30, height=5)  
        self.tip_data_Text.place(x=20, y=410, anchor=NW)

        # Button
        self.calc_button = Button(self.init_window_name, text="Calculate\nNutrition!",font=('Times New Roman', 15) ,bg="lightblue", height = 2,width=10)
        self.calc_button.place(x=255, y=200, anchor=NW)
        self.calc_button.bind("<Button-1>", self.Button_click)

        # Canvas
        self.canvas = Canvas(init_window, width = 255, height = 155)
        
    def set_StringVars(self):
        # The 6 essential nutrients:
        # Carbohydrates, Protein, Minerals, Fat, Vitamin and Water (not included here)
        self.CarFood = StringVar(init_window)
        self.ProFood = StringVar(init_window)
        self.MinFood = StringVar(init_window)
        self.FatFood = StringVar(init_window)
        self.VitFood = StringVar(init_window)

        self.CarList = ['Rice','Bread','Potato','Noodles','None']
        self.ProList = ['Beef','Chicken','Fish','Egg','None']
        self.MinList = ['Milk','Entrails','Spinach','Sardine','None']
        self.FatList = ['Fat Meat','Salad(Oil)','Nut','Fried Food','None']
        self.VitList = ['Lettuce','Cabbage','Broclli','Carrot','None']

    def set_Combox(self):

        self.style = ttk.Style()

        self.style.configure("car.TCombobox", foreground = "#1E90FF")
        self.style.configure("pro.TCombobox", foreground = "#FF00FF")
        self.style.configure("min.TCombobox", foreground = "#32CD32")
        self.style.configure("fat.TCombobox", foreground = "#FF8C00")
        self.style.configure("vit.TCombobox", foreground = "#7B68EE")

        Car = ttk.Combobox(master=init_window, width=10, style='car.TCombobox', cursor='arrow', font=('Comic Sans MS', 20), textvariable=self.CarFood, values=self.CarList)
        Pro = ttk.Combobox(master=init_window, width=10, style='pro.TCombobox', cursor='arrow', font=('Comic Sans MS', 20), textvariable=self.ProFood, values=self.ProList)
        Min = ttk.Combobox(master=init_window, width=10, style='min.TCombobox', cursor='arrow', font=('Comic Sans MS', 20), textvariable=self.MinFood, values=self.MinList)
        Fat = ttk.Combobox(master=init_window, width=10, style='fat.TCombobox', cursor='arrow', font=('Comic Sans MS', 20), textvariable=self.FatFood, values=self.FatList)
        Vit = ttk.Combobox(master=init_window, width=10, style='vit.TCombobox', cursor='arrow', font=('Comic Sans MS', 20), textvariable=self.VitFood, values=self.VitList)
        # state='readonly',

        Car.place(x=50, y=60, anchor=NW)
        Pro.place(x=50, y=130, anchor=NW)
        Min.place(x=50, y=200, anchor=NW)
        Fat.place(x=50, y=270, anchor=NW)
        Vit.place(x=50, y=340, anchor=NW)

    # Upon clicking the button:
    def Button_click(self,event):

        self.write_tip_to_Text()

        self.result_data_Text.delete(1.0,END)

        self.calc_nut()
        self.evaluate_meal()

    def calc_nut(self):

        temp = ""

        ### Carbo ###
        temp = self.CarFood.get();
        if temp == "Rice":
            self.carVal += 2
        elif temp == "Bread":
            self.carVal += 1
        elif temp == "Potato":
            self.carVal += 2
            self.vitVal += 1
        elif temp == "Noodles":
            self.carVal += 3


        ### Pro ###
        temp = self.ProFood.get();
        if temp == "Chicken":
            self.proVal += 2
        elif temp == "Fish":
            self.proVal += 2
            self.minVal += 1
        elif temp == "Beef":
            self.proVal += 2
            self.fatVal += 1
        elif temp == "Egg":
            self.proVal += 2

        ### Min ###
        temp = self.MinFood.get();
        if temp == "Milk":
            self.minVal += 1
            self.vitVal += 1
            self.proVal += 1
        elif temp == "Entrails":
            self.minVal += 2
            self.fatVal += 1
        elif temp == "Spinach":
            self.minVal += 1
            self.vitVal += 1
        elif temp == "Sardine":
            self.minVal += 1
            self.proVal += 1

        ### Fat ###
        temp = self.FatFood.get();
        if temp == "Fat Meat":
            self.fatVal += 2
        elif temp == "Salad(Oil)":
            self.fatVal += 2
        elif temp == "Nut":
            self.fatVal += 1
            self.minVal += 1
        elif temp == "Fried Food":
            self.fatVal += 2

        ### Vit ###
        temp = self.VitFood.get();
        if temp == "Lettuce":
            self.vitVal += 2
            self.minVal += 1
        elif temp == "Cabbage":
            self.vitVal += 1
        elif temp == "Broclli":
            self.vitVal += 2
            self.minVal += 2
        elif temp == "Carrot":
            self.vitVal += 1
            self.carVal += 1

    def evaluate_meal(self):

        perfect = True
        self.canvas.destroy()
        Vals = [self.carVal,self.proVal,self.minVal,self.fatVal,self.vitVal]
        maxx = self.sort_ing(Vals)
        
        self.result_data_Text.configure(width = 36, height = 11, font=("Times New Roman", 18))
        self.result_data_Text.configure(spacing1=20)
        self.result_data_Text.configure(spacing2=5)
        # self.result_data_Text.configure(spacing3=20)

        if self.carVal == 0 and self.proVal == 0 and self.minVal == 0 and self.fatVal == 0 and self.vitVal == 0:
            self.result_data_Text.insert(END,"Uh...... Do you not eat anything? You must  be a breatharian.\n")
            self.result_data_Text.insert(END,"The most nutrient in your diet is   "+maxx[1]+", in "+str(maxx[0])+" unit.")
            self.result_data_Text.tag_add("Cnt", "2.0", END) 

        else:
            if self.carVal == 0:
                self.result_data_Text.insert(END,"Your meal has too few carbohydrates! Carbohydrate is a main energy supply   of energy of human. Be sure to have     sufficient of them!\n")
                perfect = False
            elif self.carVal >= 3:
                self.result_data_Text.insert(END,"You are eating too much carbohydrate! Too much Carbo can lead to obesity.   By the way, Carbohydrate is found in   not just staple food but other stuff as   well. So watch out your diet!\n")
                perfect = False
            else:
                self.result_data_Text.insert(END,"You have a balanced Carbonhydrate intake. Well done!\n")
            self.result_data_Text.tag_add("Ccol", "1.0", "2.200")    


            if self.proVal == 0:
                self.result_data_Text.insert(END,"Your are eating too little Protein!         Protein is used in the repair and growth of body.\n")
                perfect = False
            elif self.proVal >= 3:
                self.result_data_Text.insert(END,"That's too much protein. It would increase     the burden of your liver and kidney. Make   changes right away!\n")
                perfect = False
            else:
                self.result_data_Text.insert(END,"That's neat quantity of Protein. Keep it up!\n")
            self.result_data_Text.tag_add("Pcol", "2.0", "3.200") 

            if self.minVal == 0:
                self.result_data_Text.insert(END,"You are lacking minerals in your diet! Minerals are needed for all sorts of       chemical reactions that keeps you alive.\n")
                perfect = False
            else:
                self.result_data_Text.insert(END,"Don't worry about minerals. You have eaten sufficient!\n")
            self.result_data_Text.tag_add("Mcol", "3.0", "4.200")  

            if self.fatVal == 0:
                self.result_data_Text.insert(END,"Your meal need a bit more fat. Fat is     ingredent for cell membranes!\n")
                perfect = False
            elif self.fatVal >= 3:
                self.result_data_Text.insert(END,"You may want to cut back some fat      consumption! Nasty obesity can come with too much fat.\n")
                perfect = False
            else:
                self.result_data_Text.insert(END,"Just the right amount of fat! Great job!\n")
            self.result_data_Text.tag_add("Fcol", "4.0", "5.200")  


            if self.vitVal == 0:
                self.result_data_Text.insert(END,"You need more vitamin suppliment! Or you would need vitamin tablets.\n")
                perfect = False
            else:
                self.result_data_Text.insert(END,"Awsome! Plenty of Vitamin!\n")
            self.result_data_Text.tag_add("Vcol", "5.0", "6.200")  
            

            self.result_data_Text.insert(END,"The most nutrient in your diet is:  "+maxx[1]+", in "+str(maxx[0])+" unit")
            self.result_data_Text.tag_add("Cnt", "6.0", "7.200") 


            if perfect:

                self.result_data_Text.delete(1.0,END)

                self.result_data_Text.configure(width = 17, height = 12, font=("Courier", 30))
                self.result_data_Text.configure(spacing2=10)

                self.result_data_Text.insert(END,"\n  You have made         A          Perfect Diet!  \n Congratulations!\n")

                self.result_data_Text.tag_add("ED", "2.24", "2.25")
                self.result_data_Text.tag_add("BS", "2.0", "2.24")
                self.result_data_Text.tag_add("BS", "2.26", END)

                self.canvas = Canvas(init_window, width = 255, height = 155)
                self.canvas.place(x=490, y=370, anchor=NW)
                self.canvas.create_image(0,0, anchor=NW, image=self.img)

        self.carVal = 0
        self.proVal = 0
        self.minVal = 0
        self.fatVal = 0
        self.vitVal = 0

    def sort_ing(self, rank):
        maxVal = 0
        maxNutri = ""
        
        if sum(rank,0) == 0:
            return 0, "nothing"
        else:
            for i in range(0,5):
                if rank[i] > maxVal:
                    maxVal = rank[i]
                    if i == 0:
                        maxNutri = "Carbohydrate"
                    elif i == 1:
                        maxNutri = "Protein"
                    elif i == 2:
                        maxNutri = "Fat"
                    elif i == 3:
                        maxNutri = "Minerals"
                    else:
                        maxNutri = "Vitamin"

            return maxVal, maxNutri

    def write_tip_to_Text(self):

        self.tip_data_Text.delete(1.0,END)

        lab = self.tip_LINE_NUM % 6
        self.tip_data_Text.insert(END,"\n   " + self.msg[lab])

        self.tip_LINE_NUM += 1

# Base64 Code of the Image used
